  public function __call($method, $arguments)
  {
    if (!$callable = sfMixer::getCallable('BaseCloud9Data:'.$method))
    {
      throw new sfException(sprintf('Call to undefined method BaseCloud9Data::%s', $method));
    }

    array_unshift($arguments, $this);

    return call_user_func_array($callable, $arguments);
